// src/components/TeamArea.tsx
import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';
import '../../styles/TeamArea.css';

interface Team {
  teamId: string;
  teamName: string;
}

interface Tournament {
  tournamentId: string;
  tournamentName: string;
}

const TeamArea: React.FC = () => {
  const { tournamentId } = useParams<{ tournamentId: string }>();
  const [teams, setTeams] = useState<Team[]>([]);
  const [loading, setLoading] = useState<boolean>(true);
  const [error, setError] = useState<string | null>(null);
  const [selectedTeam, setSelectedTeam] = useState<Team | null>(null);
  const [tournamentDetails, setTournamentDetails] = useState<Tournament | null>(null);
  const [showModal, setShowModal] = useState<boolean>(false);

  useEffect(() => {
    const fetchTeams = async () => {
      try {
        const token = localStorage.getItem('token');
        const response = await axios.get(`http://localhost:7000/api/tournaments/tournaments/${tournamentId}/teams`, {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });
        setTeams(response.data);
      } catch (err) {
        setError('Failed to fetch teams');
      } finally {
        setLoading(false);
      }
    };

    const fetchTournamentDetails = async () => {
      try {
        const token = localStorage.getItem('token');
        const response = await axios.get(`http://localhost:7000/api/tournaments/${tournamentId}`, {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });
        setTournamentDetails(response.data);
      } catch (err) {
        setError('Failed to fetch tournament details');
      }
    };

    fetchTeams();
    fetchTournamentDetails();
  }, [tournamentId]);

  const handleJoinTeam = (team: Team) => {
    setSelectedTeam(team);
    setShowModal(true);
  };

  const registerPlayer = async () => {
    if (selectedTeam) {
      try {
        const token = localStorage.getItem('token');
        await axios.post(`http://localhost:7000/api/teams/register-player`, {
          teamId: selectedTeam.teamId,
        }, {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });
        alert('Successfully registered for the team!');
      } catch (err) {
        setError('Failed to register for the team');
      } finally {
        setShowModal(false);
      }
    }
  };

  if (loading) return <div>Loading teams...</div>;
  if (error) return <div>{error}</div>;

  return (
    <div className="team-area-container">
      <h2 className="team-heading">Teams in Tournament</h2>
      <div className="team-cards-container">
        {teams.map((team) => (
          <div key={team.teamId} className="team-card">
            <img src="https://via.placeholder.com/80" alt="Team Logo" className="team-logo" />
            <div className="team-info">
              <h3 className="team-name">{team.teamName}</h3>
              <p className="team-id">ID: {team.teamId}</p>
              <button className="join-team-button" onClick={() => handleJoinTeam(team)}>Join Team</button>
            </div>
          </div>
        ))}
      </div>

      {showModal && (
        <div className="modal-overlay">
          <div className="modal-content">
            <h2>Confirm Joining Team</h2>
            <h3>Team: {selectedTeam?.teamName}</h3>
            <p>ID: {selectedTeam?.teamId}</p>
            {tournamentDetails && (
              <>
                <h4>Tournament Details</h4>
                <p>Name: {tournamentDetails.tournamentName}</p>
                <p>ID: {tournamentDetails.tournamentId}</p>
              </>
            )}
            <div className="modal-actions">
              <button className="confirm-button" onClick={registerPlayer}>Confirm</button>
              <button className="cancel-button" onClick={() => setShowModal(false)}>Cancel</button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default TeamArea;
